import React from 'react'
import styled from 'styled-components'


const Container = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
`

const Link = styled.a`
    position: relative;
    text-transform: uppercase;
    letter-spacing: 0.1em;
    font-weight: 400;
    transition: 0.5s;
    font-size: 1.6rem;
    padding: 10px 20px;

    &:hover{
        background: teal;
        letter-spacing: 0.25em;
        box-shadow: 0 0 35px teal; 
    }


`

const ButtonSpan = styled.span`
    color: white;
    text-shadow: -1px -1px 0 #000,  
                 2px -1px 0 #000,
                -1px  2px 0 #000,
                 2px  2px 0 #000;  
`


const Button = () => {
  return (
    <Container>
        <Link>
            <ButtonSpan>Hello</ButtonSpan>
        </Link>
    </Container>
  )
}

export default Button
